import React, { Component } from 'react';
import { View, Text, StyleSheet, Image, TouchableHighlight, TouchableOpacity } from 'react-native';

class Headercomponent extends Component{

    constructor(props) {
        super(props);
    }

    back = () =>{
        this.props.navigation.goBack()
    }

    createLogo = () => {
        if(this.props.init){
            return <Text style={styles.logo}>Time Tracker</Text>
        }else{
            return (
                <TouchableOpacity style={styles.imgTouch} onPress={this.back}>
                    <Image source={require('../../assets/back.png')} style={{height: 20, width: 20}}></Image>
                </TouchableOpacity>
            )
        }
    }

    createTitle = () => {
        if(this.props.cor == 'branco'){
            return <Text style={styles.titulo2}>{this.props.titulo}</Text>
        }else{
            return <Text style={styles.titulo}>{this.props.titulo}</Text>
        }
    }

    render(){
        return (
            <View style={styles.header}>
                {
                   this.createLogo()
                }
                {
                   this.createTitle()
                }
                <Image source={{uri: 'data:image/png;base64,'}} style={styles.icone}></Image>
            </View>
        )
    }
}

const styles = StyleSheet.create({
    header: {
        width: '100%',
        display: "flex",
        flexDirection: "row",
        alignItems: "center",
        justifyContent: "space-around"
    },
    icone:{
        width: 50,
        height: 50,
        borderRadius: 100
    },
    titulo: {
        color: '#FF473A',
        fontSize: 20
    },
    titulo2: {
        color: '#FFF',
        fontSize: 20
    },
    logo: {
        fontSize: 8,
        textAlign: "left"
    }
});

export default Headercomponent;